// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";


contract TowerClimb is Ownable, ReentrancyGuard {
    // Game state enum
    enum GameState { Uninitialized, Initialization, ReadyForRound, Submission, Processing, Ended }

    // State variables
    address[] public players;                   // List of all players
    mapping(address => uint8) public currentLevel; // Player levels (0-50)
    mapping(address => bool) public isActive;   // Whether player is still active
    mapping(address => uint8) public submittedMove; // Move submitted this round (0-5, 255 = not submitted)
    uint256 public currentRound;                // Current round number
    GameState public gameState;                 // Current game phase
    uint256 public submissionDeadline;          // Timestamp when submission phase ends
    uint256 public capPerFloor;                 // Max players per level (1-49) before elimination
    uint256 public targetWinners;               // Target number of winners (N/2)
    address[] public winners;                   // List of winners when game ends

    // Events
    event GameInitialized(address[] players);
    event GameStarted();
    event RoundStarted(uint256 roundNumber);
    event MoveSubmitted(address indexed player, uint8 move);
    event PlayerEliminated(address indexed player);
    event PlayerWon(address indexed player);
    event GameEnded(address[] winners);
    event GameReset();

    // Constructor to set initial state and owner
    constructor() Ownable(msg.sender) {
        gameState = GameState.Uninitialized;
    }

    // Initialize the game with a list of players
    function initializeGame(address[] memory _players) external onlyOwner {
        require(gameState == GameState.Uninitialized, "Already initialized");
        require(_players.length >= 10 && _players.length % 2 == 0, "Invalid number of players");

        uint256 N = _players.length;
        targetWinners = N / 2;
        capPerFloor = (N / 5) / 2; // Integer division

        for (uint256 i = 0; i < N; i++) {
            address player = _players[i];
            require(player != owner(), "Owner cannot be a player");
            require(!isActive[player], "Duplicate player");
            isActive[player] = true;
            currentLevel[player] = 0;
            submittedMove[player] = 255;
        }
        players = _players;
        gameState = GameState.Initialization;
        emit GameInitialized(_players);
    }

    // Start the game, moving to ReadyForRound state
    function gameStart() external onlyOwner {
        require(gameState == GameState.Initialization, "Invalid state");
        gameState = GameState.ReadyForRound;
        emit GameStarted();
    }

    // Start a new round, opening the submission phase
    function startRound() external onlyOwner {
        require(gameState == GameState.ReadyForRound, "Invalid state");
        currentRound++;
        submissionDeadline = block.timestamp + 120; // 2 minutes in seconds
        gameState = GameState.Submission;
        emit RoundStarted(currentRound);
    }

    // Players submit their move during the submission phase
    function submitMove(uint8 move) external nonReentrant {
        require(gameState == GameState.Submission && block.timestamp < submissionDeadline, "Cannot submit now");
        require(isActive[msg.sender], "Not an active player");
        require(move <= 5, "Invalid move");
        submittedMove[msg.sender] = move;
        emit MoveSubmitted(msg.sender, move);
    }

    // End the current round, callable only by owner after deadline
    function endRound() external onlyOwner {
        require(gameState == GameState.Submission && block.timestamp >= submissionDeadline, "Cannot end round yet");
        processRound();
    }

    // Reset the game to its initial state, callable only by owner
    function resetGame() external onlyOwner {
        for (uint256 i = 0; i < players.length; i++) {
            address player = players[i];
            currentLevel[player] = 0;
            isActive[player] = false;
            submittedMove[player] = 255;
        }
        delete players;
        delete winners;
        currentRound = 0;
        gameState = GameState.Uninitialized;
        submissionDeadline = 0;
        capPerFloor = 0;
        targetWinners = 0;
        emit GameReset();
    }

    // Internal function to process the round
    function processRound() internal {
        gameState = GameState.Processing;

        for (uint256 i = 0; i < players.length; i++) {
            address player = players[i];
            if (isActive[player]) {
                uint8 move = (submittedMove[player] != 255) ? submittedMove[player] : 0;
                uint8 newLevel = currentLevel[player] + move;
                if (newLevel > 50) newLevel = 50;
                currentLevel[player] = newLevel;
                if (newLevel == 50) {
                    emit PlayerWon(player);
                }
            }
        }

        uint256[50] memory levelCounts;
        uint256 count50 = 0;
        for (uint256 i = 0; i < players.length; i++) {
            address player = players[i];
            if (isActive[player]) {
                uint8 level = currentLevel[player];
                if (level == 50) {
                    count50++;
                } else if (level >= 1 && level <= 49) {
                    levelCounts[level]++;
                }
            }
        }

        for (uint256 level = 1; level <= 49; level++) {
            if (levelCounts[level] > capPerFloor) {
                for (uint256 i = 0; i < players.length; i++) {
                    address player = players[i];
                    if (currentLevel[player] == level && isActive[player]) {
                        isActive[player] = false;
                        emit PlayerEliminated(player);
                    }
                }
            }
        }

        uint256 activeCount = 0;
        for (uint256 i = 0; i < players.length; i++) {
            if (isActive[players[i]]) {
                activeCount++;
            }
        }

        if (count50 >= targetWinners) {
            for (uint256 i = 0; i < players.length; i++) {
                if (currentLevel[players[i]] == 50) {
                    winners.push(players[i]);
                }
            }
            gameState = GameState.Ended;
            emit GameEnded(winners);
        } else if (activeCount <= targetWinners) {
            for (uint256 i = 0; i < players.length; i++) {
                if (isActive[players[i]]) {
                    winners.push(players[i]);
                }
            }
            gameState = GameState.Ended;
            emit GameEnded(winners);
        } else {
            for (uint256 i = 0; i < players.length; i++) {
                submittedMove[players[i]] = 255;
            }
            gameState = GameState.ReadyForRound;
        }
    }

    // View function to get a player's current level
    function getCurrentLevel(address player) external view returns (uint8) {
        return currentLevel[player];
    }

    // View function to get the list of active players
    function getActivePlayers() external view returns (address[] memory) {
        uint256 count = 0;
        for (uint256 i = 0; i < players.length; i++) {
            if (isActive[players[i]]) {
                count++;
            }
        }
        address[] memory activePlayers = new address[](count);
        uint256 index = 0;
        for (uint256 i = 0; i < players.length; i++) {
            if (isActive[players[i]]) {
                activePlayers[index] = players[i];
                index++;
            }
        }
        return activePlayers;
    }

    // View function to get the list of winners
    function getWinners() external view returns (address[] memory) {
        require(gameState == GameState.Ended, "Game not ended yet");
        return winners;
    }
}

