// SPDX-License-Identifier: MIT
pragma solidity ^0.8.25;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

contract ValhallaOrHel is Ownable, ReentrancyGuard {
    enum RoundStatus { READY, IN_PROGRESS, COMPLETED }

    struct GameInstance {
        address[] players;
        uint256 currentRound;
        RoundStatus status;
        uint256 roundStartTime;  // Added to track round timing
    }

    GameInstance[] public gameInstances;
    mapping(address => uint256) public playerToInstance;

    uint256 public constant ROUND_DURATION = 120;  // 2 minutes in seconds

    event GameInitialized(uint256 indexed instanceId, address[] players);
    event AllRoundsStarted(uint256 indexed currentRound);
    event AllRoundsCompleted(uint256 indexed currentRound);
    event RoundStarted(uint256 indexed instanceId, uint256 roundNumber);
    event RoundCompleted(uint256 indexed instanceId, uint256 roundNumber);
    event DoorOpened(address indexed player, bool result);
    event PlayerEliminated(address indexed player, uint256 indexed instanceId);

    constructor() Ownable(msg.sender) {
    }

    function setupGame(address[] calldata players) external onlyOwner {
        require(players.length >= 100, "Minimum 100 players required");

        uint256 numInstances = players.length / 20;

        for (uint256 i = 0; i < numInstances; i++) {
            gameInstances.push(GameInstance({
                players: new address[](0),
                currentRound: 0,
                status: RoundStatus.READY,
                roundStartTime: 0  // Initialize with 0
            }));
        }

        for (uint256 i = 0; i < players.length; i++) {
            uint256 instanceId = i % numInstances;
            gameInstances[instanceId].players.push(players[i]);
            playerToInstance[players[i]] = instanceId;
        }

        for (uint256 i = 0; i < numInstances; i++) {
            emit GameInitialized(i, gameInstances[i].players);
        }
    }

    function startRound() external onlyOwner {
        uint256 totalInstances = gameInstances.length;
        require(totalInstances > 0, "No game instances exist");

        for (uint256 i = 0; i < totalInstances; i++) {
            GameInstance storage instance = gameInstances[i];
            require(instance.status == RoundStatus.READY, "Instance not ready");

            instance.status = RoundStatus.IN_PROGRESS;
            instance.roundStartTime = block.timestamp;  // Set start time
            emit RoundStarted(i, instance.currentRound);
        }

        emit AllRoundsStarted(gameInstances[0].currentRound);
    }

    function endRound() external onlyOwner {
        uint256 totalInstances = gameInstances.length;
        require(totalInstances > 0, "No game instances exist");

        for (uint256 i = 0; i < totalInstances; i++) {
            GameInstance storage instance = gameInstances[i];
            require(instance.status == RoundStatus.IN_PROGRESS, "Instance not in progress");
            require(block.timestamp >= instance.roundStartTime + ROUND_DURATION, 
                   "Round duration not yet completed");

            instance.currentRound++;
            instance.status = RoundStatus.READY;
            instance.roundStartTime = 0;  // Reset start time
            emit RoundCompleted(i, instance.currentRound);
        }

        emit AllRoundsCompleted(gameInstances[0].currentRound);
    }

    function openDoor() external nonReentrant returns (bool) {
        uint256 instanceId = playerToInstance[msg.sender];
        require(instanceId < gameInstances.length, "Caller is not an active player");

        GameInstance storage instance = gameInstances[instanceId];
        require(instance.status == RoundStatus.IN_PROGRESS, "Instance not in progress");
        require(block.timestamp < instance.roundStartTime + ROUND_DURATION, 
               "Round time has expired");
        require(isPlayerInInstance(instance, msg.sender), "Caller is not in this instance");

        bool result = _generateRandomBool(msg.sender);

        if (!result) {
            _eliminatePlayer(msg.sender, instanceId);
        }

        instance.status = RoundStatus.COMPLETED;
        emit RoundCompleted(instanceId, instance.currentRound);
        emit DoorOpened(msg.sender, result);

        return result;
    }

    function _eliminatePlayer(address player, uint256 instanceId) private {
        GameInstance storage instance = gameInstances[instanceId];

        for (uint256 i = 0; i < instance.players.length; i++) {
            if (instance.players[i] == player) {
                instance.players[i] = instance.players[instance.players.length - 1];
                instance.players.pop();
                break;
            }
        }

        delete playerToInstance[player];

        if (instance.players.length == 0) {
            instance.status = RoundStatus.COMPLETED;
        }

        emit PlayerEliminated(player, instanceId);
    }

    function isPlayerInInstance(GameInstance storage instance, address player) private view returns (bool) {
        for (uint256 i = 0; i < instance.players.length; i++) {
            if (instance.players[i] == player) {
                return true;
            }
        }
        return false;
    }

    function _generateRandomBool(address player) private view returns (bool) {
        uint256 randomNumber = uint256(
            keccak256(abi.encodePacked(block.timestamp, block.prevrandao, player))
        ) % 2;

        return randomNumber == 1;
    }

    function getInstancePlayers(uint256 instanceId) external view returns (address[] memory) {
        return gameInstances[instanceId].players;
    }

    function getPlayerInstance(address player) external view returns (uint256) {
        return playerToInstance[player];
    }

    function getInstanceCount() external view returns (uint256) {
        return gameInstances.length;
    }

    // Added function to check remaining time in a round
    function getRoundTimeRemaining(uint256 instanceId) external view returns (uint256) {
        require(instanceId < gameInstances.length, "Invalid instance ID");
        GameInstance storage instance = gameInstances[instanceId];

        if (instance.status != RoundStatus.IN_PROGRESS || instance.roundStartTime == 0) {
            return 0;
        }

        uint256 timeElapsed = block.timestamp - instance.roundStartTime;
        if (timeElapsed >= ROUND_DURATION) {
            return 0;
        }
        return ROUND_DURATION - timeElapsed;
    }
}

